import React from 'react'
// import { IoTimeSharp } from 'react-icons/io5'
// import { NavLink } from 'react-router-dom'
import { SidebarData } from '../data/SidebarData'

const Sidebar = () => {
  return (
    <>
        <section>
            <div className="bg-slate-900 text-xl font-normal">
                {
                    SidebarData.map((item, index) => {
                        return(
                            <div key={index}>
                                <div className="hover:bg-red-500 pl-7 mt-7 w-full h-14 font-bold flex justify-start items-center text-white text-l space-x-1">
                                    <span>{item.icon}</span>
                                    <span>{item.title}</span>
                                </div>
                            </div>
                        )
                    })
                }
            </div>
        </section>
    </>
  )
}

export default Sidebar
